/**
 * @module common.api
 */
import angular from 'angular';

import _ from 'lodash';

function ResourceProvider() {
    var config = {
        baseURL: ''
    };

    this.setConfig = function(opts) {
        _.extend(config, opts);
    };

    this.$get = [function() {
        return config;
    }];
}

ResourceProvider.$inject = [];

function ResourceFactory($http, ResourceConfig) {

    function wrapResult(resultPromise, ResultModel) {
        return resultPromise.then(function(response) {
            return new ResultModel(response.data);
        });
    }

    function serialize(obj) {
        return _(obj).keys().map(function(key) {
            return `encodeURIComponent(${key})=encodeURIComponent(${obj[key]})`;
        }).value().join('&');
    }

    function returnResponse(response) {
        return response.data;
    }

    class Resource {
        /**
         * Base Resource class for constructing new REST routes
         * @class
         * @param  {string} route The path to the endpoint
         * @param  {function} model Optional model to be applied to the fetched resource
         * @param  {Object} options Optional configuration object
         */
        constructor(route, model, options = {}) {
            let opts = {};
            // allow global config to be overridden here
            _.extend(opts, ResourceConfig, options);

            this.route = `${opts.baseURL}/${route}`;
            this.model = model;
            this.options = opts;
        }

        get(pk, config = {}) {
            let result = $http.get(`${this.route}/${pk}`, config);

            if (this.model !== undefined) {
                return wrapResult(result, this.model);
            } else {
                return result.then(returnResponse);
            }
        }

        create(obj, config = {}) {
            return $http.post(`${this.route}`, obj, config).then(returnResponse);
        }

        update(pk, obj, config = {}) {
            return $http.put(`${this.route}/${pk}`, obj, config).then(returnResponse);
        }

        search(params, config = {}) {
            let route = this.route;

            if (params) {
                params = serialize(params);

                route = `${route}?${params}`;
            }

            let result = $http.get(`${route}`, config);

            if (this.model !== undefined) {
                let Model = this.model;

                return result.then(function(response) {
                    response.data = _.map(response.data, function(obj) {
                        return new Model(obj);
                    });

                    return response.data;
                });
            } else {
                return result.then(returnResponse);
            }
        }

        delete(pk, config = {}) {
            return $http.delete(`${this.route}/${pk}`, config);
        }
    }

    return Resource;
}

ResourceFactory.$inject = ['$http', 'ResourceConfig'];

export default angular.module('common.api', [])

.provider('ResourceConfig', ResourceProvider)

.factory('Resource', ResourceFactory);

import angular from 'angular';
import 'angular-mocks';

import './';

class Foo {
    constructor(data) {
        this.data = data;
    }
}

describe('ResourceConfigProvider', function() {
    var ResourceConfig;

    angular.module('test', []).config(function(ResourceConfigProvider) {
        ResourceConfigProvider.setConfig({
            baseURL: 'http://jsonplaceholder.typicode.com'
        });
    });

    beforeEach(angular.mock.module('common.api'));
    beforeEach(angular.mock.module('test'));

    beforeEach(inject(function($injector) {
        ResourceConfig = $injector.get('ResourceConfig');
    }));

    it('should change the baseURL if the baseURL is provided', function() {
        expect(ResourceConfig).to.exist;
        expect(ResourceConfig.baseURL).to.not.be.empty;
        expect(ResourceConfig.baseURL).to.equal('http://jsonplaceholder.typicode.com');
    });
});

describe('Resource', function() {
    var testResource;
    var Resource;

    beforeEach(angular.mock.module('common.api'));

    beforeEach(inject(function($injector) {
        Resource = $injector.get('Resource');

        class TestResource extends Resource {
            constructor() {
                super('test', Foo);
            }
        }

        testResource = new TestResource();
    }));

    it('should expose the CRUD methods and search', function() {
        expect(testResource).to.be.an.instanceof(Resource);

        expect(testResource).to.have.property('get');
        expect(testResource).to.have.property('create');
        expect(testResource).to.have.property('update');
        expect(testResource).to.have.property('search');
        expect(testResource).to.have.property('delete');
    });

    it('should set the route correctly', function() {
        expect(testResource.route).to.exist
            .and.to.equal('/test');
    });

    it('should set the model correctly', function() {
        expect(testResource.model).to.equal(Foo);
    });
});

/**
 * @module common.filters
 */
import angular from 'angular';

/**
 * @example <p>{{obj.value | default:'Some other value'}}</p>
 * @author Will
 * @param {any} value The value to be tested
 * @param {any} defaultValue The fallback value
 */
function defaultFilter() {
    return function(value, defaultValue) {
        // if the value is invalid, return the default value
        if (value === undefined || value === null) {
            return defaultValue || '-';
        }
        return value;
    };
}

defaultFilter.$inject = [];

export default angular.module('common.filters', [])

.filter('default', defaultFilter);

import angular from 'angular';
import 'angular-mocks';

import './';

describe('common/filters', function() {
    var $filter;

    beforeEach(function() {
        angular.mock.module('common.filters');

        inject(function(_$filter_) {
            $filter =  _$filter_;
        });
    });

    describe('default filter', function() {
        var defaultFilter;

        beforeEach(function() {
            // helper function so we don't have to keep saying that
            // we are using the 'default' filter
            defaultFilter = function(value, defaultValue) {
                return $filter('default')(value, defaultValue);
            };
        });

        it('should return the default value if the input is null', function() {
            let result = defaultFilter(null, 'defaultValue');

            expect(result).to.equal('defaultValue');
        });

        it('should return the default value if the input is undefined', function() {
            let result = defaultFilter(undefined, 'defaultValue');

            expect(result).to.equal('defaultValue');
        });

        it('should return NaN if the input is NaN', function() {
            let result = defaultFilter(NaN, 'defaultValue');

            expect(result).to.not.equal('defaultValue');
            expect(result).to.deep.equal(NaN);
        });

        it('should return the input string if it is truthy', function() {
            let result = defaultFilter('truthyValue', 'defaultValue');

            expect(result).to.equal('truthyValue');
        });
    });
});

import angular from 'angular';
import 'angular-material';

class NavigationCtrl {
    constructor($rootScope, $mdSidenav, $mdMedia) {
        this.$mdSidenav = $mdSidenav;
        this.$mdMedia = $mdMedia;

        this.navItems = $rootScope.navItems;
    }

    toggle(side = 'left') {
        this.$mdSidenav(side).toggle();
    }
}

NavigationCtrl.$inject = ['$rootScope', '$mdSidenav', '$mdMedia'];

function navigationDirective() {
    return {
        restrict: 'E',
        replace: true,
        controller: 'NavigationCtrl',
        controllerAs: 'Navigation',
        template: require('./_navigation.html')
    };
}

navigationDirective.$inject = [];

export default angular.module('common.navigation', [
    'ngMaterial'
])

.controller('NavigationCtrl', NavigationCtrl)

.directive('navigation', navigationDirective);

/**
 * @module users.edit
 */
import angular from 'angular';
import 'angular-ui-router';
import 'angular-material';

import commonApi from 'common/api';

import states from './states.json';

const STATE = 'app.users.edit';

class UsersEditCtrl {
    constructor($mdToast, UserResource, user) {
        this.$mdToast = $mdToast;

        this.UserResource = UserResource;

        this.user = user;
        this.states = states;
    }

    save() {
        let result;

        if (this.user.id) {
            result = this.UserResource.create(this.user);
        } else {
            result = this.UserResource.update(this.user.id, this.user);
        }

        result.then(() => {
            let $mdToast = this.$mdToast;

            $mdToast.show($mdToast.simple().content('Saved!'));
        });
    }
}

UsersEditCtrl.$inject = [
    '$mdToast',
    'UserResource',
    'user'
];

export default angular.module('users.edit', [
    'ngMaterial',
    commonApi.name
])

.config(['$stateProvider', function($stateProvider) {
    $stateProvider.state(STATE, {
        controller: 'UsersEditCtrl',
        controllerAs: 'UsersEdit',
        url: '/edit/:id',
        template: require('./_edit.html'),
        resolve: {
            user: ['UserResource', '$stateParams',
                function(UserResource, $stateParams) {
                    return UserResource.get($stateParams.id);
                }
            ]
        }
    });
}])

.controller('UsersEditCtrl', UsersEditCtrl);

/**
 * @module users
 */
import angular from 'angular';
import 'angular-ui-router';

import commonApi from 'common/api';

import {User} from './models';

import edit from './edit';

const STATE = 'app.users';

class UsersCtrl {
    constructor(users) {
        this.users = users;
    }
}

UsersCtrl.$inject = ['users'];

function UserResourceFactory(Resource) {
    class UserResource extends Resource {
        constructor() {
            super('users', User);
        }
    }

    return new UserResource();
}

UserResourceFactory.$inject = ['Resource'];

export default angular.module('users', [
    commonApi.name,
    edit.name
])

.config(['$stateProvider', function($stateProvider) {
    $stateProvider.state(STATE, {
        controller: 'UsersCtrl',
        controllerAs: 'Users',
        url: '/users',
        template: require('./_users.html'),
        resolve: {
            users: ['UserResource', function(UserResource) {
                return UserResource.search();
            }]
        }
    });
}])

.controller('UsersCtrl', UsersCtrl)

.factory('UserResource', UserResourceFactory);

export var userNavigation = {
    state: STATE,
    name: 'Users',
    icon: 'face'
};

